import { JoinButton } from "@/app/events/ethcon-korea/components";
import Button from "@/components/Button";
import { useRainbowContext } from "@/contexts/RainbowProvider";
import ArrowBackIosIcon from "@mui/icons-material/ArrowBackIos";
import Link from "next/link";
import { usePathname } from "next/navigation";
import { useEffect } from "react";
import { scrollSepolia } from "viem/chains";
import { useSwitchNetwork } from "wagmi";

export default function EthconSectionHeader() {
  const pathname = usePathname();
  const { walletCurrentAddress, chainId } = useRainbowContext();
  const { switchNetwork } = useSwitchNetwork();

  useEffect(() => {
    if (!walletCurrentAddress) return;

    if (switchNetwork && chainId !== scrollSepolia.id)
      switchNetwork(scrollSepolia.id);
  }, [switchNetwork, chainId]);

  return (
    <div className="flex h-[32rem] items-stretch justify-center bg-[#FFF0DD]">
      <div className="flex flex-auto items-center justify-between px-10 pt-[6.5rem]">
        <div className="flex h-full flex-col justify-between">
          <Link href="/hackathon" className="flex items-center text-md">
            <ArrowBackIosIcon
              className="text-sm"
              sx={{
                fontSize: "small",
              }}
            />
            <p>Back to Event</p>
          </Link>

          <div className="py-4">
            <div className="flex flex-row items-center justify-between gap-4 hover:cursor-default">
              <div className="flex flex-auto flex-row items-center justify-center rounded-full bg-white px-2 py-2">
                <img
                  src="/images/events/icon/calendar.svg"
                  width="24"
                  height="24"
                  className="mr-2"
                  alt="Calendar Icon"
                />
                <p className="text-[1.6rem] font-semibold leading-[2.4rem]">
                  October 19-20, 2024
                </p>
              </div>
              <div className="flex flex-row items-center justify-center rounded-full bg-white px-2 py-2 hover:cursor-default">
                <img
                  src="/images/events/icon/calendar.svg"
                  width="24"
                  height="24"
                  className="mr-2"
                  alt="Calendar Icon"
                />
                <p className="text-[1.6rem] font-semibold leading-[2.4rem]">
                  Korea
                </p>
              </div>
            </div>
            <p className="text-[56px] font-semibold">Ethcon Challenges</p>

            <div className="flex items-stretch gap-2">
              <JoinButton />

              {pathname === "/events/ethcon-korea/scoreboard" ? (
                <Button
                  whiteButton={true}
                  width="50%"
                  href="/events/ethcon-korea"
                >
                  Challenges
                </Button>
              ) : (
                <Button
                  whiteButton={true}
                  width="50%"
                  href="/events/ethcon-korea/scoreboard"
                >
                  Scoreboard
                </Button>
              )}
            </div>
          </div>
        </div>
        <img
          src="data:image/svg+xml;base64,"
          className={`max-h-full object-contain max-md:max-h-[90%]`}
        />
      </div>
    </div>
  );
}
